import{_ as e,g as o}from"./app.a39ec552.js";const i={},p=o('<h1 id="omnia-fx-components" tabindex="-1"><a class="header-anchor" href="#omnia-fx-components" aria-hidden="true">#</a> Omnia Fx components</h1><blockquote><p>Tip: Try to use the component inside your .tsx file then you might find out more information through its interface definition or its data model.</p></blockquote><blockquote></blockquote><ul><li><p>People picker</p><p>The <code>omfx-people-picker</code> allows you to pick users or microsoft groups.</p></li><li><p>Term picker</p><p>The <code>omfx-term-picker</code> allows you to pick taxonomy terms in a term set.</p></li><li><p>Term set picker</p><p>The <code>omfx-termset-picker</code> allows you to pick a term set in term store.</p></li><li><p>Date time picker</p><p>The <code>omfx-date-time-picer</code> offers the user a visual representation for selecting date time.</p></li><li><p>Color picker</p><p>The <code>omfx-color-picker</code> allows you to select a color using a variety of input methods.</p></li><li><p>Language picker</p><p>The <code>omfx-language-picker</code> allow you to select a language.</p></li><li><p>Icon picker</p><p>The <code>omfx-icon-picker</code> allows you to select a icon from multiple sources of icons.</p></li><li><p>Icon</p><p>The <code>omfx-icon</code> helps you to display icon.</p></li><li><p>Draggable</p><p>The <code>draggable</code> from Vue.Draggable 2.0 is included in Omnia.</p><p>https://github.com/SortableJS/Vue.Draggable</p></li><li><p>Button</p><p>The <code>omfx-button</code> is a wrapper of the standard vuetify&#39;s <code>v-button</code>, which has more functionality and ease of use. (i.e. display tooltip over a button).</p></li><li><p>Document icon</p><p>The <code>omfx-document-icon</code> helps you to display icon depending on file type.</p></li><li><p>File uplodaer</p><p>The <code>omfx-file-uploader</code> provides standard file upload component.</p></li><li><p>Resizing iframe</p><p>The <code>omfx-iframe</code> - a resizing iframe based on its contents.</p></li><li><p>Letter avatar</p><p>The <code>omfx-letter-avatar</code> - 1 or 2 letters will be rendered by an initial name.</p></li><li><p>Site Logo</p><p>The <code>omfx-site-logo-icon</code> helps you to resolve and render SharePoint site logo from a site url.</p></li><li><p>Media picker</p><p>The <code>omfx-media-picker</code> is a powerful component for image/video selection and transformation.</p></li><li><p>Multilingual input</p><p>The <code>omfx-multilingual-input</code> provides an input component for multilingual content.</p></li><li><p>Rich text editor</p><p>The <code>omfx-rich-text-editor</code> provides an input component for rich-text content.</p></li><li><p>Spacing picker</p><p>The <code>omfx-spacing-picker</code> provides an input component for the margin/padding.</p></li></ul>',4);function t(c,l){return p}var r=e(i,[["render",t],["__file","index.html.vue"]]);export{r as default};
